import React from "react";

function Footer() {
    return (
        <>
            <style>{`
                .footer {
                    background-color: #fafafa;
                    font-size: 14px;
                    color: #444;
                }

                .footer h6 {
                    font-weight: 600;
                    margin-bottom: 12px;
                }

                .footer a {
                    color: #666;
                    text-decoration: none;
                    display: block;
                    margin-bottom: 8px;
                }

                .footer a:hover {
                    color: #387ed1;
                }

                .footer-logo {
                    width: 140px;
                    margin-bottom: 12px;
                }

               .social-icons a {
                 width: 40px;
  height: 40px;
  border-radius: 50%;
  background: #f2f2f2;
  display: inline-flex;
  align-items: center;
  justify-content: center;
                color: #000;
                font-size: 22px;
                margin: 0 10px;
                transition: color 0.3s, transform 0.3s;
                }

               .social-icons a:hover {
                color: #0077b5;
